package com.ruchij;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

class AllSubstringsOfAGivenStringTest {
    private final AllSubstringsOfAGivenString allSubstringsOfAGivenString = new AllSubstringsOfAGivenString();

    @Test
    void testOne() {
        assertEquals(10, allSubstringsOfAGivenString.uniqueLetterString("ABC"));
        assertEquals(8, allSubstringsOfAGivenString.uniqueLetterString("ABA"));
        assertEquals(92, allSubstringsOfAGivenString.uniqueLetterString("LEETCODE"));
        assertEquals(36330847, allSubstringsOfAGivenString.uniqueLetterString(""));
    }

}